import React , {Component} from "react"
import Cards from "./Cards"
import Categery from"./Categery"
import Welcome from"./Welcome"
import NavBar from"./NavBar"

class Home extends Component{

    state={
        data:{
            _id:"",
            Name: "",
            Price: "",
            Description: "",
            Categery:"",
            SellingBy:""

        },
        Categery:["Laptop", "Smart Phones","Accessories"]
        ,
        user:{
            Name:"",
            Email: "",
            Password: "",
            CreatedItems: []
        }


    }

    handleDeleteBtn=(product)=>{
        DeleteProduct(product)
    }

    render(){
        return(
            <React.Fragment>
                <NavBar/>
                <Welcome/>
                <div className="container">
                    <Categery Categery={this.state.Categery}/>
                    <Cards/>
                </div>
            </React.Fragment>
        )
    }
}

export default Home;
